import React, { Component } from 'react';
import './index.css';


class Header extends Component {


  render(){

    return (
      <div className='header'>
        <h1 className='main-title'>Susanne Loquet. MSW. LCSW.</h1>
      </div>
    );
  }
}

export default Header;
